I wanted to relieve my anxiety this week because it was as if I'd hit a wall otherwise.
It's scary because its been so long. At first I was in denial - I cant be feeling this way again, this feeling has been so distance for a long time , but it just swooped in.
And rather than becoming totally overwhelmed and feeling useless, I gave myself space.
I had a lovely week with my family exploring Mayo. We had little to no signal and it felt so refreshing.
Instead of comparing my life to others and seeing the constant comments and news stories that can drag us down, I just enjoyed the world around me.
I felt grounded and I felt grateful.
Previous to this I felt lost and scared.
But now I feel like I reconnected with myself.
I had time to think about what would make me happy rather than what would look good in the eyes of others, because with very little signal, I was no longer in the eyes of others.
Only my own.
The ones that matter most.
And the same goes for you, the way you see yourself Is the most important
I'm sure we have all received compliments from others but didnt feel like they were true because we werent feeling good.
Equally I'm sure we have all had nasty things said about us but didnt feel like we deserved them.
We dont need the approval of others or the bitchyness of others to prove our worth.
